export const state = () => ({
  image: 'data:image/png;base64,',
  name: 'Nico Develop'
});

export const mutations = {
  setImage(state, image) {
    state.image = image
  },
  setName(state, name) {
    state.name = name
  }
};

export const getters = {
  getImage(state) {
    return state.image
  },
  getName(state) {
    return state.name
  }
};
